:text: "U H\t+\nDescendants of WILLIAMS, Henry and COLDHAM, Marianne\nJWILLIAMS, Marianne
  and DAVIES, Christopher Pearson\nI DAVIES, George Henry and GODFREY, Rose Alma\nJDAVIES,
  Christopher ap Rhys and HAWKES, Lilian Margaret\nI DAVIES, Margaret Dorothy and
  BRAMLEY, Frank William (Bill)\nIBRAMLEY, Peter Rhys Ealand and BAKER, Marie Noelene\n02>
  BRAMLEY, William Rhys\nb 03.07.1992\nWilliam b. at Taumarunui.\n03> BRAMLEY, Rebecca
  Julia\nb 07.01.1995\nRebecca b. at Taumarunui.\nMaan\nNCAAL2S2W\n03> BRAMLEY, Michael
  Guy m on 07.11.1994 to NORTON, Kiri Terehea\nb 24.03.1964\nb 06.02.1966\nMichael
  b. at Taihape and m. at Hamilton. Address: PO Box 301 Matamata.\nMichael was educated
  at Kirikau Primary School, St George's, Wanganui, Palmerston\nNorth Boys' High School
  and Massey University. While at High School he gained first\nplace in the New Zealand
  Interschool Crosscountry event. He graduated from Massey\nwith a Bachelor of Agriculture.
  He farmed in the Manawatu and Wellington areas and\nwas working with a stock firm
  in Camden, Australia. He is now with the Livestock\nImprovement Corporation as a
  consulting officer. He was based in Hokitika in 1994-97 then\ntransferred to the
  Waikato as a consulting officer for Livestock Improvement Advisory, covering the\nMatamata
  region. His interests include rugby, canoeing and cross-country running.\nKiri was
  educated at St Dominic College, Auckland. She then went to Carrington Technical
  Institute\nfor a year, obtaining a Certificate in Secretarial Studies. She moved
  to Australia in 1986 where\nshe worked for various mining companies. She and Mike
  returned to New Zealand in 1993. Her\ninterests are swimming, running and old movies.\n01>
  BRAMLEY, Rhain Daniel\nb 07.12.1990\nRhain b. at Camden, Australia.\n02> BRAMLEY,
  Rachel Stacey\nb 12.09.1994\nRachel 6. at Hamilton.\n07>' DAVIES, Thomas\nb ** **
  **** d ** ** ****\nThomas d, as an infant.\n08> DAVIES, Henry\nb ** ** **** d **
  ** ****\nHenry d. as an infant.\n02> DAVIES, Henry\nb 19.08.1845 d 19.02.1918\nHenry
  b. at Tauranga and d. at Napier.\n1 2 3 4 5 6 7 8 9\n198\n"
